uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel1; // METAL TEXTURE (Slot 1)

// User Parameters
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_twist;
uniform float u_thickness;
uniform float u_glow_intensity;
uniform float u_wave_height;
uniform float u_wave_freq;

out vec4 fragColor;

// --- Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// --- Carpet Logic ---
float getCarpetWave(vec2 p) {
    float t = iTime * u_speed;
    float wave = sin(p.x * u_wave_freq + t) * cos(p.y * u_wave_freq * 0.8 + t * 0.5);
    wave += 0.5 * sin(p.x * u_wave_freq * 2.1 - t * 1.2);
    wave *= u_wave_height;
    return wave;
}

// Distance Function
float map(vec3 p) {
    float t = iTime * u_speed * 0.5;

    // Carpet Floor
    float waveHeight = getCarpetWave(p.xz);
    float floorDist = p.y - waveHeight;

    // Strands
    float strands = 1e10;

    for(float i = 0.0; i < 3.0; i += 1.0) {
        float offset = i * 2.0;
        vec2 pathPoint = vec2(p.x, sin(p.x * 0.2 + t + offset) * 5.0);
        float pathWave = getCarpetWave(vec2(p.x, pathPoint.y));

        vec3 strandPos = vec3(p.x, pathWave + 0.5, pathPoint.y);
        vec3 q = p - strandPos;
        q.xz *= rot(p.x * u_twist + t);

        float ribbon = length(q.yz) - u_thickness * (0.5 + 0.3 * sin(p.x * 2.0 + t));
        strands = smin(strands, ribbon, 1.2);
    }

    return smin(floorDist, strands, 0.8);
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float globalTime = iTime * u_speed;

    // --- Camera ---
    vec3 ro = vec3(globalTime * 2.0, u_camera_dist, 0.0);
    float lookAheadX = ro.x + 5.0;
    float lookAtY = getCarpetWave(vec2(lookAheadX, 0.0)) * 0.5;
    vec3 ta = vec3(lookAheadX, lookAtY, 0.0);

    vec3 cw = normalize(ta - ro);
    vec3 cu = normalize(cross(cw, vec3(0, 1, 0)));
    vec3 cv = normalize(cross(cu, cw));
    vec3 rd = normalize(uv.x * cu + uv.y * cv + u_fov * cw);

    // --- Raymarching ---
    float t = 0.0;
    float d = 0.0;
    float glow = 0.0;

    for(int i = 0; i < 80; i++) { 
        vec3 p = ro + rd * t;
        d = map(p);
        glow += 0.012 / (0.08 + d * d);
        if(d < 0.002 || t > 60.0) break;
        t += d * 0.7; 
    }

    vec3 col = vec3(0.0);

    // --- Shading ---
    if(t < 60.0) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);

        // 1. FROZEN COLORS
        // Shifted palette to Icy Cyan / White / Pale Blue
        vec3 iceColor = 0.6 + 0.4 * cos(vec3(0.0, 0.4, 0.8) + p.x * 0.2 + p.y * 0.5);

        // 2. THE CORE TEXTURE
        vec3 mechTex = texture(iChannel1, p.xz * 0.3).rgb;
        if(length(mechTex) < 0.05) mechTex = vec3(0.8); // Brighter fallback for ice

        // 3. THE "FROZEN CORE" BLEND
        // We tint the texture with the ice color, but keep it dark (trapped inside)
        vec3 interior = mechTex * iceColor * 0.8;

        // Lighting
        vec3 lp = ro + vec3(2.0, 5.0, -2.0);
        vec3 ld = normalize(lp - p);
        float diff = max(dot(n, ld), 0.0);

        // 4. THE ICE SHELL (Specular & Fresnel)
        // High power Fresnel makes edges look transparent/glassy
        float fres = pow(1.0 + dot(rd, n), 3.0);
        // Ultra sharp specular for wet/ice look
        float spec = pow(max(dot(ref, ld), 0.0), 64.0); 

        // COMPOSITE:
        // Start with the interior (dark texture)
        col = interior * diff;

        // ADD THE SHELL ON TOP
        // The Fresnel is pure Cyan/White light bouncing off the smooth surface
        col += vec3(0.6, 0.9, 1.0) * fres * 1.5; 

        // Add the sharp hotspot
        col += vec3(1.0) * spec; 
    }

    // --- Atmosphere / Glow ---
    // Cold Cyan Glow
    vec3 glowCol = 0.5 + 0.5 * cos(vec3(0.0, 0.3, 0.6) + globalTime * 0.3);
    col += glow * glowCol * u_glow_intensity;

    // Distance fog (Ice Blue)
    col = mix(col, vec3(0.05, 0.1, 0.2), smoothstep(20.0, 60.0, t));

    // Contrast & Cold Tone Mapping
    col = smoothstep(-0.05, 1.1, col);
    col = pow(col, vec3(0.9)); 

    fragColor = vec4(col, 1.0);
}

